import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { CharactersResponse } from '../shared/models/characters-response';

@Injectable({
  providedIn: 'root'
})
export class DashboardCharacterService {

  constructor(private http: HttpClient) { }

  getData(url: string): Observable<CharactersResponse> {
    //transformar el dato en la url correcta
    var res = this.http.get<CharactersResponse>(url);
    return res;
  }
}
